import React, {Component, useState} from 'react';
import { Button, Input } from '@material-ui/core';
export class Todo extends Component{
    constructor(props){
        super(props);
        this.state = {
            todo: ['Ahmad', 'ALi', 'Abdullah'],
            input: '',
        }
    }
    render(){
        return(
            <>
            <Input input={(event)=> event.ta} placeholder='Enter Todo'/>
            <Button type='submit' style={{backgroundColor: 'blue', marginTop: '10px'}}>Submit</Button>
            <ul>
                {this.state.todo.map((todo)=>(
                    <li>
                        {todo}
                    </li>
                ))}
            </ul>
            </>
        )
    }
}
